(66, 2, 'iPhone 16 Pro Max 27', NULL, 1000000.00, 500000.00, 10, 'Hiệu năng Pro Max. Trí tuệ AI tiên tiến. Camera linh hoạt – sáng tạo mọi khoảnh khắc.', '<p><strong>Sẵn sàng định hình tương lai, iPhone 16 Pro Max là siêu phẩm đột phá từ Apple, mang đến sự bứt phá về hiệu suất, thời lượng pin và trải nghiệm người dùng. Với chip A18 Pro mạnh mẽ, viền màn hình siêu mỏng và bộ công cụ Apple Intelligence thông minh, đây là chiếc iPhone đáng mong đợi nhất từ trước đến nay.</strong></p><img src=\"data:image/webp;base64,\"><p style=\"text-align: justify\"></p><p style=\"text-align: justify\"><strong>Vẻ đẹp tinh tế từ khung vỏ titan cao cấp</strong></p><p style=\"text-align: justify\">iPhone 16 Pro Max sử dụng khung vỏ chế tác từ Titanium Cấp 5, một chất liệu siêu bền và siêu nhẹ, đem lại cảm giác chắc chắn nhưng không hề nặng tay. Đây là yếu tố làm nên sự sang trọng và giúp gia tăng độ bền đáng kể cho thiết bị, sẵn sàng đồng hành cùng bạn trong mọi hành trình.</p><p style=\"text-align: justify\">Thêm vào đó, công nghệ Ceramic Shield tiên tiến bảo vệ màn hình cực kỳ hiệu quả, giúp chống trầy xước và hạn chế hư hại do va đập. Sản phẩm trình làng với bốn tùy chọn màu sắc cao cấp gồm Titan Đen, Titan Trắng, Titan Tự Nhiên và Titan Sa Mạc. Tất cả đều toát lên vẻ đẳng cấp và phô diễn cá tính riêng biệt.</p><img src=\"data:image/webp;base64,\">', 3, 0),
